description:
Be aware of your family and kids safety! With the help of "Number Tracker" you can know all necessary about their location just using a phone number. Locate them even if they are in a different part of the world!

WITH THE "NUMBER TRACKER" YOU ARE ABLE TO:
- Keep an eye on your kids to make sure they are fine. Your family map will always be in contact;
- Share your real time location on map;
- Find your relatives by their phone number. They must have the app installed & agree to share their location;
- The quickest way to find out everything about your children and friends without messaging;
- Monitor the battery level of your family member's phones;
- The high security of your private data is guaranteed.

USE SMART CIRCLES:
- Create a circle of places or people who all share their locations within the group members;
- Invite group members by sharing a unique code number;
- Edit profiles of circle members (avatar, name), remove any member or even delete a circle completely;
- You can also track the full history of a circle member's movements on the map;
- Customize notifications within a particular circle;
- As the circle owner you can temporarily hide your current location or set up a fake one.

Enjoy using "Number Tracker", be sure of your family safety and always stay in contact with them.

SUBSCRIPTION TERMS:

- After you subscribe, you can manage your account and turn off automatic renewal in Account Settings.
- Your subscription is renewed automatically if you do not cancel it within 24 hours before its expiration date.
- When you purchase the app, your iTunes account is billed.
- Subscription fees: 7 days subscription - $7.99
- Account will be charged for renewal within 24-hours prior to the end of the current period.
- Automatic renewals will cost the actual price shown in Subscription conditions section.
- Your personal data is stored securely.
Privacy Policy: https://numbertracker360.com/privacy-policy
Terms of Use: https://numbertracker360.com/terms-of-use
